Orkes Gumarang adolah suatu kalompok palopor dalam industri musik Indonesia, nan malakuan kagiatannyo sajak 1950-an sampai 1970-an. Para musisinyo adolah rang Minang sadonyo dari Sumatera Barat, namun marakam musiknyo di Jakarta. Musik orkes ko acok disabuik Mambo Sumatera, dek maniru pamenan musik Latin atau Mambo Kuba walau dipangaruahi juo jo irama musik Minang.
Sijarah.
Orkes ko dibantuak pado akia 1953 di Jakarta dek Alidir sabagai pamimpinnyo, sarato Anwar Anif, Dhira Suhud, Joeswar Khairudin, Taufik, Syaiful Nawa, jo Awaludin sabagai anggotanyo. Namo orkes diambiak dari carito rakyaik tamusaua, "Kaba Cindua Mato", di ma Gumarang adolah namo kudo ajaib miliak Si Cindua Mato.
Orkes Gumarang mulai mandapek paratian sasudah maisi acara di Radio Republik Indonesia (RRI), iyolah stasiun radio nagara. Orkes Alidir baasia luluih dari audisi untuak. Musik Minang ukatu tu lah dimainan dek acara "Penghibur Hati", dan kalompok musik ko pun mampopulerkannyo labiah jauah lai.
Bulan Mei 1955, Alidir diganti dek Asbon Madjid sabagai katua. Asbon tatap bakacimpuang sabagai katua orkes ko inggo wafaiknyo dek karano panyakik lever taun 1980. Nan kudian turuik bagabuang juo adolah pamain piano Januar Arifin, panyanyi Nurseha, sato Anas Yusuf. Asbon jo Januar kaduonyo mambao irama Latin ka dalam kalompok ko. Panampilan Orkes Gumarang indak anyo di RRI sajo, tapi di tampek-tampek lainnyo sarupo Gaduang Kasenian Jakarta, Istano Nagara dan Istora Senayan.
Pamainan Gumarang di RRI dirakan dek parusaoan rakaman nagara Lokananta, tapi label partikulia Irama kudian mangaik orkes tu. Kalompok mainterpretasikan lagu-lagu Minang, nan karangan kalompok ko surang maupun karangan urang lain. Barasianyo mareka mainspirasi tigo orkestra Minang lainnyo, iyolah Zaenal Combo pimpinan Zaenal Arifin, Teruna Ria pimpinan Oslan Husein, dan Kumbang Tjari pimpinan Nuskan Syarif, nan katigo-tigonya mairiangi kabanyakan panyanyi-panyanyi Indonesia maso taun 1960-an.

