Bangkok adolah ibukota sarato kota nan paliang padek di Thailand. Dalam baso Thai, namo kota ko "Krung Thep Maha Nakhon" (, diijo ) atau singkeknyo . Laweh kota mancapai 1.568,7 km2 (605,7 mil2) nan talatak di delta Batang Chao Phraya di Thailand Tangah, dan bapopulasi labiah saketek daripado salapan juta jiwa, atau 12,6 prosen dari total panduduak nagara ko. Labiah dari ampek baleh juta jiwa (22,2 prosen) juga tingga di daerah di sakuliliang kota nan disabuik pulo Wilayah Bangkok Metropolitan. Dek karanonyo Bangkok manjadi kota nan sabana utamo sato nan paliang pantiang di antaro pusek-pusek urban di Thailand lainnyo.

